import React, { useState } from 'react';
import App from './App';
import './sidebar.css';

function Sidebar({ onMenuClick }) {
  return (
    <aside className="sidebar">
      <nav className="menu">
        <ul>
          <li onClick={() => onMenuClick('overview')} className="active" id="dashboardBtn">Dashboard</li>
          <li onClick={() => onMenuClick('storage')} id="storageBtn">Storage</li>
          <li onClick={() => document.onMenuClick('reports')} id="reportsBtn">Reports</li>
          <li onClick={() => document.onMenuClick('settings')} id="settingsBtn">Settings</li>
        </ul>
      </nav>
      <nav className="footer-menu">
        <ul>
          <li onClick={() => document.onMenuClick('help')} id="helpBtn">Help</li>
          <li onClick={() => document.onMenuClick('faq')} id="faqBtn">FAQ</li>
          <li onClick={() => document.onMenuClick('about')} id="aboutBtn">About Us</li>
        </ul>
      </nav>
    </aside>
  );
}

export default Sidebar;
